import EventCard from "../comps/eventCard";
import Grid from "@material-ui/core/Grid";

function Timeline(props) {
    const style = {
        color: "white",
        fontSize: 8,
        lineHeight: 4
    };

    function fillEvents(events) {
        var time = 0;
        var filledEvents = [];
        events.map(event => {
            if (time < event.startTime) {
                filledEvents.push({
                    startTime: time,
                    endTime: event.startTime,
                    cal: null
                });
                filledEvents.push(event);
                time = event.endTime;
            } else {
                filledEvents.push(event);
                time = event.endTime;
            }
        });
        return filledEvents;
    }

    return fillEvents(props.events).map(event => {
        if (event.cal !== null) {
            <Grid container spacing={1}>
                <Grid item xs={2}>
                    <p style={{ color: "white", fontSize: 16 }}>
                        {parseInt(event.startTime / 60)} :{" "}
                        {event.startTime % 60}
                    </p>
                    <p style={{ color: "gray", fontSize: 8 }}>
                        {parseInt(event.endTime / 60)} : {event.endTime % 60}
                    </p>
                </Grid>
                <Grid item xs={10}>
                    <EventCard event={event} />
                </Grid>
            </Grid>;
        } else {
            <Grid container spacing={1}>
                <Grid item xs={2}></Grid>
                <Grid item xs={10}>
                    <EventCard event={event} />
                </Grid>
            </Grid>;
        }
    });
}

export default Timeline;
